import React, { useState } from "react";
import { initializeApp } from "firebase/app";
import {
  getStorage,
  ref,
  uploadBytes,
  getDownloadURL,
  deleteObject,
} from "firebase/storage";
import "./Food.css";

// Firebase configuration
const firebaseConfig = {
  apiKey: "AIzaSyB-L2pj_4XVH9y7VBYOSAsTsT8p4cveHZY",
  authDomain: "foodai-7ebf0.firebaseapp.com",
  databaseURL: "https://foodai-7ebf0-default-rtdb.firebaseio.com",
  projectId: "foodai-7ebf0",
  storageBucket: "foodai-7ebf0.appspot.com",
  messagingSenderId: "1802738846",
  appId: "1:1802738846:web:f6985b95b8487ce3c7ef8f",
  measurementId: "G-QJWXCZ7Y56",
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
const storage = getStorage(app);

const Food = () => {
  const [image, setImage] = useState(null);
  const [imagePreview, setImagePreview] = useState(null);
  const [result, setResult] = useState(null);
  const [uploadedImageUrl, setUploadedImageUrl] = useState(null);

  const handleImageUpload = (e) => {
    const file = e.target.files[0];
    if (file) {
      setImage(file);
      setImagePreview(URL.createObjectURL(file));
    }
  };

  const uploadToFirebase = async () => {
    if (!image) {
      alert("Please upload or capture an image first.");
      return;
    }

    const storageRef = ref(storage, `images/${image.name}`);
    try {
      await uploadBytes(storageRef, image);
      const downloadUrl = await getDownloadURL(storageRef);
      setUploadedImageUrl(downloadUrl);
      return downloadUrl;
    } catch (error) {
      console.error("Error uploading image to Firebase:", error);
      return null;
    }
  };

  const analyzeFood = async () => {
    const imageUrl = await uploadToFirebase();
    if (!imageUrl) {
      alert("Image upload failed. Please try again.");
      return;
    }

    const city = "YourCityName"; // Replace with dynamic location if needed
    const requestData = { imageUrl, location: city };

    try {
      const response = await fetch("https://foodapi-sa0l.onrender.com/analyze", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(requestData),
      });

      const data = await response.json();
      setResult({
        status: data.response.state,
        daysUntilSpoilage: data.meta_data.exp_date,
      });
    } catch (error) {
      console.error("Error analyzing food:", error);
      setResult({ status: "Error", daysUntilSpoilage: null });
    }
  };

  const reset = async () => {
    if (uploadedImageUrl) {
      const fileRef = ref(storage, `images/${image.name}`);
      try {
        await deleteObject(fileRef);
        console.log("Image deleted from Firebase.");
      } catch (error) {
        console.error("Error deleting image from Firebase:", error);
      }
    }
    setImage(null);
    setImagePreview(null);
    setResult(null);
    setUploadedImageUrl(null);
  };

  return (
    <div className="food-container">
      <div className="food-header">
        <h1 className="food-title">AI Food Analyzer</h1>
      </div>
      <p className="food-description">
        Upload or capture food photos to check for spoilage. 
        Our AI ensures quality by detecting signs of freshness or decay.
      </p>
      <div className="upload-container">
        <input
          className="file-input"
          type="file"
          accept="image/*"
          onChange={handleImageUpload}
        />
        <button className="analyze-button" onClick={analyzeFood}>
          üîç Analyze
        </button>
      </div>
      {result && (
        <div className="analysis-result">
          <div className="image-preview-container">
            <img
              className="image-preview-large"
              src={imagePreview}
              alt="Analyzed food"
            />
          </div>
          <div className="result-container">
            <p className="result-text">üß™ Result: {result.status}</p>
            <p className="result-text">
              ‚åõ Days Until Spoilage: {result.daysUntilSpoilage}
            </p>
          </div>
          <button className="reset-button" onClick={reset}>
            üîÑ Reset
          </button>
        </div>
      )}
    </div>
  );
};

export default Food;
